profile:
Aceda às notícias mais importantes selecionadas pelos editores da RTP em texto, vídeo ou áudio onde quer que esteja, a partir do seu iPhone ou iPad. Poderá ainda guardar a informação que mais lhe interessa para ver ou ouvir mais tarde.

Mantenha-se informado com notificações em tempo real sempre que surja informação que os nossos editores achem relevantes.

Com um interface simples e intuitivo, poderá seguir acontecimentos ao vivo, ver a emissão da RTP3 ou ouvir a Antena 1 em qualquer lugar. 

Principais funcionalidades:
- Acesso aos destaques editoriais selecionados pelos editores da RTP;
- Área de destaques editoriais de desporto;
- Nova área de artigos ao vivo;
- Notificações em tempo real;
- Área de artigos guardados para aceder mais tarde;
- Acesso a artigos em áudio;
- Acesso a artigos em vídeo;
- Emissão em direto da RTP3;
- Emissão em direto da Antena 1;
- Envio de mensagens à redação da RTP;

A Aplicação RTP é totalmente gratuita.

